INSERT INTO `field_data_body` VALUES ('node', 'page', '0', '1', '1', 'und', '0', 'ed about a disease.\r\n\r\nIt’s not good enough to recruit participants who generally fit the demographic profile, such as by age, gender, income level, and location. Such criteria are too broad to give you deep insight. General recruitment criteria won’t cut it. You must find people who are actually in the process of researching the information you are evaluating.\r\n \r\nBe aware of the limitations of unmoderated studies: Unmoderated studies are done without the facilitator present: Participants work on their own. This method can be useful for getting user feedback on narrow parts of the site such as workflow or snippets of information. However, when trying to discover how people conduct research, compare offerings, and make decisions, the best approach is to conduct a moderated study, where the facilitator is present.\r\n\r\nContent studies tend to have long stretches of time when the user is simply scanning page after page—in silence. When left alone (such as in an online unmoderated situation) users may feel awkward and wonder whether they’re being helpful. Without proper feedback and reassurance, participants often alter their behavior by approaching the task in a more superficial manner. Task times are often shorter for online studies than in traditional test settings. When on their own, participants assume that the goal is to work quickly, not realistically.\r\n\r\nAlso, the facilitator can ask the user for clarifications.. With unmoderated studies, you miss opportunities to ask personalized, user-tailored follow-up questions. Even though participants are instructed to think out loud, they often forget to explain their actions and thoughts.\r\n \r\nGive tasks that are tailored for each individual: In most traditional usability studies, researchers follow a prepared script and give study participants prescripted tasks to perform. For content testing minimize your reliance on a script. Spend time at the beginning of each session to discuss the participant’s situation and make sure the task scenario matches their exact circumstance. It’s OK to prepare some more generic tasks prior to the study, but be willing to modify or craft new ones on the spot as you learn more about the participant’s situation, and as the session unfolds. You want t', '', 'filtered_html');
INSERT INTO `field_revision_body` VALUES ('node', 'page', '0', '1', '1', 'und', '0', 'ed about a disease.\r\n\r\nIt’s not good enough to recruit participants who generally fit the demographic profile, such as by age, gender, income level, and location. Such criteria are too broad to give you deep insight. General recruitment criteria won’t cut it. You must find people who are actually in the process of researching the information you are evaluating.\r\n \r\nBe aware of the limitations of unmoderated studies: Unmoderated studies are done without the facilitator present: Participants work on their own. This method can be useful for getting user feedback on narrow parts of the site such as workflow or snippets of information. However, when trying to discover how people conduct research, compare offerings, and make decisions, the best approach is to conduct a moderated study, where the facilitator is present.\r\n\r\nContent studies tend to have long stretches of time when the user is simply scanning page after page—in silence. When left alone (such as in an online unmoderated situation) users may feel awkward and wonder whether they’re being helpful. Without proper feedback and reassurance, participants often alter their behavior by approaching the task in a more superficial manner. Task times are often shorter for online studies than in traditional test settings. When on their own, participants assume that the goal is to work quickly, not realistically.\r\n\r\nAlso, the facilitator can ask the user for clarifications.. With unmoderated studies, you miss opportunities to ask personalized, user-tailored follow-up questions. Even though participants are instructed to think out loud, they often forget to explain their actions and thoughts.\r\n \r\nGive tasks that are tailored for each individual: In most traditional usability studies, researchers follow a prepared script and give study participants prescripted tasks to perform. For content testing minimize your reliance on a script. Spend time at the beginning of each session to discuss the participant’s situation and make sure the task scenario matches their exact circumstance. It’s OK to prepare some more generic tasks prior to the study, but be willing to modify or craft new ones on the spot as you learn more about the participant’s situation, and as the session unfolds. You want t', '', 'filtered_html');
